function dydt = ODE(t,y,par)
flux1 = par(1)/(1+y(2)+par(8)*y(1));
flux2 = par(2)*y(1)*y(2);   
flux3 = par(3)*y(1);            
flux4 = par(4)*y(2);
flux5 = par(5)*y(1)*(par(7)-y(3));
flux6 = par(6)*y(3)*y(2);
InfluxG = par(9);

dydt(1,:) = flux1 -flux2 -flux5 +InfluxG;%Glu
dydt(2,:) = flux3 -flux4;                %Ins
dydt(3,:) = flux5 -flux6;                %stGlu
dydt(4,:) = flux2 -flux1 +flux5;         % uptake
end